import CreateAccountForm from './CreateAccountForm'
import Button from 'react-bootstrap/Button'

const NewUserPopup = () =>{
  return(
    <div className='popUp'>
    <CreateAccountForm/>
    <Button variant='danger'>Cancel</Button>
    </div>
  )
}

export default NewUserPopup
